import "./NavBar.css";
function NavBar() {
  return (
    <>
      <header>
        <nav>
          <div className="left">
            <img src="./images/amazon.webp" alt="image" />
          </div>
          <div className="right"></div>
        </nav>
      </header>
    </>
  );
}

export default NavBar;
